import React, { useEffect, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Carousel } from "react-bootstrap";
import Header from "./Header";
import "../styles/Dashboard.css";

const Dashboard = () => {
  const [isLoading, setIsLoading] = useState(true);
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    setTimeout(() => {
      setIsLoading(false);
    }, 2000);

    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };

    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  return (
    <div>
      {isLoading && (
        <div className="preloader">
          <div className="spinner"></div>
        </div>
      )}

      <Header />

      {/* Hero Section with Flipkart-Style Carousel */}
      <div className="hero-section">
        <Carousel controls={true} indicators={true} interval={3000} pause={false} fade>
          <Carousel.Item>
            <img
              src="https://source.unsplash.com/1600x600/?electronics,shopping"
              className="d-block w-100"
              alt="Electronics Sale"
            />
            <Carousel.Caption>
              <h3>Exclusive Deals on Electronics</h3>
              <p>Grab the latest gadgets at unbeatable prices!</p>
              <a href="/electronics" className="btn btn-warning">Shop Now</a>
            </Carousel.Caption>
          </Carousel.Item>

          <Carousel.Item>
            <img
              src="https://source.unsplash.com/1600x600/?fashion,clothing"
              className="d-block w-100"
              alt="Fashion Sale"
            />
            <Carousel.Caption>
              <h3>Fashion Sale - Up to 70% Off</h3>
              <p>Upgrade your wardrobe with trending styles.</p>
              <a href="/fashion" className="btn btn-primary">Shop Now</a>
            </Carousel.Caption>
          </Carousel.Item>

          <Carousel.Item>
            <img
              src="https://source.unsplash.com/1600x600/?smartphones,technology"
              className="d-block w-100"
              alt="Best Smartphones"
            />
            <Carousel.Caption>
              <h3>Best Smartphones of 2025</h3>
              <p>Find the perfect phone for you at the best price.</p>
              <a href="/smartphones" className="btn btn-success">Shop Now</a>
            </Carousel.Caption>
          </Carousel.Item>

          <Carousel.Item>
            <img
              src="https://images.wallpapersden.com/image/ws-hacker-anonymous-evil_71902.jpg"
              className="d-block w-100"
              alt="Gadgets & Accessories"
            />
            <Carousel.Caption>
              <h3>Latest Gadgets & Accessories</h3>
              <p>Discover innovative tech for daily use.</p>
              <a href="/gadgets" className="btn btn-danger">Shop Now</a>
            </Carousel.Caption>
          </Carousel.Item>

          {isMobile && (
            <Carousel.Item>
              <img
                src="https://images.wallpapersden.com/image/ws-wwdc-2019-apple_65069.jpg"
                className="d-block w-100"
                alt="Smartphone Exclusive"
              />
              <Carousel.Caption>
                <h3>Exclusive Deals for Mobile Users</h3>
                <p>Shop the best offers directly from your phone!</p>
                <a href="/smartphones" className="btn btn-info">Explore Now</a>
              </Carousel.Caption>
            </Carousel.Item>
          )}
        </Carousel>
      </div>

      {/* Welcome Section */}
      <div className="container my-5 text-center">
        <h2>Welcome to E-Mart</h2>
        <p>Discover the latest trends in fashion, electronics, and more!</p>
        <a href="/productpage" className="btn btn-primary btn-lg">
          Start Shopping
        </a>
      </div>
    </div>
  );
};

export default Dashboard;
